import {TFunction} from 'i18next'

import {formatDate} from 'utils'
import {BankTransfer, Payment, Transfer} from 'api/Response'
import {AllCurrencyType} from 'constants/currency.config'

const formatNumber = (number: string | number, toFixed = 2) =>
  Number(Number(number).toFixed(toFixed))

export const html = ({
  paymentData,
  bankDetails,
  currency,
  t,
}: {
  paymentData: Payment | Payment<Transfer>
  bankDetails: BankTransfer
  currency: AllCurrencyType
  t: TFunction
}) => `<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=595.28px, initial-scale=1.0">
    <style>
              body {
                  font-family: 'Roboto', sans-serif;
                  font-size: 16px;
                  padding: 0 60px;
              }
      
              h1 {
                  text-align: center;
                  font-size: 24px;
                  font-weight: 500;
              }
      
              .top-section {
                  margin-top: 30px;
                  display: flex;
                  align-items: center;
                  justify-content: center;
                  flex-direction: column;
                  border-bottom: 1px solid #d9d9d9;
              }
      
              .img {
                  width: 60px;
              }
      
              .container {
                  margin-left: 55px;
                  margin-right: 55px;
                  margin-top: 20px;
              }
      
              .order-title {
                  font-size: 12px;
                  margin-bottom: 20px;
              }
      
              .box {
                  display: flex;
                  margin-top: 15px;
                  font-size: 16px;
                  margin-left: 12px;
                  padding-bottom: 15px;
              }
              
              .top-left-element {
                  width: 160px; 
              }
      
              .left-element {
                  width: 150px; 
              }
              
              .payment-container{
                 margin-top: 20px;
              }
              
              .title-with-img{
                display: flex;
                column-gap: 10px;
                
              }
              .payment-img{
                height: 15px;
                width:15px;
              }
              
              .bank-transfer-details {
                margin-top: 20px;
              }

              .gap {
                margin-bottom: 25px;
              }

              .top-gap{
                margin-top: 20px; 
              }
              
              .bank-title {
                margin-top: 14px;
                font-size: 14px;
                margin-left: 12px;
              }
              
              .box-with-divider{
                  display: flex;
                  gap: 10px;
                  margin-top: 12px;
                  font-size: 16px;
                  margin-left: 12px;
                  padding-bottom: 12px;
              }
              
              .divider {
                margin-left: 12px;
                border-bottom: 0.3px solid #d9d9d9;
              }

              .key {
                  font-family: "Inter", sans-serif;
                  font-weight: 600;
                  color: #c9cdd2;
                  font-size: 12px;
                  line-height: 1.2;
                  width: 40%;
              }
      
              .value {
                  font-family: "Inter", sans-serif;
                  font-weight: 600;
                  color: #5e6978;
                  font-size: 12px;
                  line-height: 1.2;
                  text-transform: capitalize;
                  width: 60%;
                  flex-wrap: wrap;
              }
          </style>
</head>

<body>
    <div class='top-section'>
        <img class='img' src="data:image/png;base64,">
        <h1>${t('pdf.title')}</h1>
    </div>

    <div class="container">
        
        <div class='order-container'>
            <div class='order-title'>${t('pdf.orderDetails')}</div>
            <div class='box'>
                <div class='top-left-element'>${t('pdf.orderId')}</div>
                <div class='right-element'>${paymentData.id}</div>
            </div>
            <div class='box'>
                <div class='top-left-element'>${t('pdf.orderDate')}</div>
                <div class='right-element'>${formatDate(paymentData.created_at)}</div>
            </div>
            <div class='box'>
                <div class='top-left-element'>${t('pdf.totalPurchase')}</div>
                <div class='right-element'>${formatNumber(paymentData.received_amount_number, 4)} ${
  paymentData.received_amount_currency
}</div>
            </div>
               <div class='box'>
                <div class='top-left-element'>${t('pdf.pricePerBWG')}</div>
                <div class='right-element'>${formatNumber(paymentData.total_rate)} ${currency}</div>
            </div>
            <div class='box'>
                <div class='top-left-element'>${t('pdf.totalPrice')}</div>
                <div class='right-element'>${formatNumber(
                  paymentData.total_amount
                )} ${currency}</div>
            </div>
        </div>
        
         <div class='payment-container'>
            <div class='order-title'>${t('pdf.paymentDetails')}</div>
            <div class='box'>
                <div class='top-left-element title-with-img'>
                    <div>
                      <img class='payment-img' src="data:image/png;base64,">
                    </div>
                    <div>${t('pdf.paymentBy')}</div> 
                </div>
                <div class='right-element'>${t('pdf.bankTransfer')}</div>
            </div>
            
            
            <div class='box'>
                <div class='top-left-element title-with-img'>
                    <div>
                      <img class='payment-img' src="data:image/png;base64,">
                    </div>
                    <div>${t('pdf.depositTo')}</div>
                </div>
                <div class='right-element'>${bankDetails?.beneficiary_name}</div>
            </div> 
        </div>
        
        <div class='bank-transfer-details'>
           <div class='order-title gap'>${t('pdf.subTitle')}</div>
            <div>
              <div class='box-with-divider'>
                <div class='left-element'>${t('pdf.accountName')}</div>
                <div class='right-element'>${bankDetails?.beneficiary_name}</div>
               </div>
                <div class='divider'/>
            </div>
            
             <div>
              <div class='box-with-divider'>
                <div class='left-element'>${t('pdf.bic')}</div>
                <div class='right-element'>${bankDetails?.bank_swift_code}</div>
               </div>
                <div class='divider'/>
            </div>
            

            ${
              bankDetails?.beneficiary_iban_usd
                ? `<div>
                 <div class='box-with-divider'>
                   <div class='left-element'>${t('pdf.iban')}</div>
                   <div class='right-element'>${
                     currency === 'USD'
                       ? bankDetails?.beneficiary_iban_usd
                       : bankDetails?.beneficiary_iban_eur
                   }</div>
                  </div>
                   <div class='divider'/>
               </div>`
                : ''
            }

           ${
             bankDetails?.beneficiary_account_number
               ? ` <div>
              <div class='box-with-divider'>
                <div class='left-element'>${t('pdf.iban')}</div>
                <div class='right-element'>${bankDetails?.beneficiary_account_number}</div>
               </div>
                <div class='divider'/>
            </div>`
               : ''
           }
            
            
             <div>
              <div class='box-with-divider'>
                <div class='left-element'>${t('pdf.bankName')}</div>
                <div class='right-element'>${bankDetails?.bank_name}</div>
               </div>
              <div class='divider'/>
            </div>
            
           ${
             bankDetails?.bank_address
               ? `<div>
              <div class='box-with-divider'>
                <div class='left-element'>${t('pdf.bankAddress')}</div>
                <div class='right-element'>${bankDetails?.bank_address}</div>
               </div>
              <div class='divider'/>
            </div> `
               : ''
           }

            <div>
             <div class='box-with-divider'>
               <div class='left-element'>${t('pdf.reference')}</div>
               <div class='right-element'>${bankDetails?.payment_reference}</div>
              </div>
           </div> 
        </div>
        
    </div>
    
    
</body>

</html>`
